import React from 'react';
import { AppBar, CssBaseline, Toolbar, Typography , Box , IconButton ,Button } from '@mui/material'
import { PhotoCamera ,  } from '@mui/icons-material';


const App = () => {

    return (
            <>

            <CssBaseline/>

                {/* Navigation Bar  */}

            <Box sx={{ flexGrow: 1 }}>
                <AppBar position="static">
                    <Toolbar>
                    <IconButton
                        size="large"
                        edge="start"
                        color="inherit"
                        aria-label="menu"
                        sx={{ mr: 2 }}
                    >
                        <PhotoCamera />
                    </IconButton>
                    <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                        News
                    </Typography>
                    <Button color="inherit">Login</Button>
                    </Toolbar>
                </AppBar>

                <main>
                    

                </main>


            </Box>

            {/* Section - 1 Below Header part  */}
           
            </>

        );
}

export default App;
